import React from 'react';
import Gallery from './Art&Craft/Art';
import Art_data from './Art&Craft/Art_data';




const Art =(props)=>{

    return (
        <>

        <div className="col-lg-3 col-md-4 col-6 mx-auto">
            <figure className="art_gal">
            <img className="img-fluid" src={props.img} alt="...."/>
        
            </figure>
        </div>
        <div className="container-fluid my-5">
         
              
         <div className="row">
         {
           Art_data.map((val, ind) => {
                             return <Gallery
                                 img={val.img}
                                 key={ind}
                             />
                             })  

         }
         </div>
</div>
        




        </>
    )
}

export default Art
